    private byte[] hexStringToBytes(String s) {
        String[] hexes = s.split(" ");
        byte[] bytes = new byte[hexes.length];
        for (int i = 0; i < hexes.length; i++) {
            bytes[i] = (byte) Integer.parseInt(hexes[i], 16);
        }
        return bytes;
    }

